import axios from "axios"
import { useState } from "react"

function Tag({ tag }) {
  const [isHover, setIsHover] = useState(false)

  return (
    <h3 className="TagName" onMouseEnter={setIsHover(true)} onMouseLeave={setIsHover(false)}>
      {isHover ? "X" : "#"}
      {tag.name}
    </h3>)
}

export default Tag
